import React, { Component } from 'react';
import { Tabs, Tab, Grid, Cell, Card, CardTitle, CardText, CardActions, Button, CardMenu, IconButton } from 'react-mdl';
import ProjCard from './subcomponents/projCard';


class Projects extends Component {

    constructor(props) {
        super(props);
        this.state = {activeTab: 0};
    }

    toggleCategories() {


        if (this.state.activeTab === 0) {
            return(
                <div className="projects-grid">

                    {/* Project 1
                    <Card shadow={2} style={{minWidth: '500', margin: 'auto'}}>
                        <CardTitle style={{color: '#fff', height: '176px', background: 'url(https://www.adobe.com/content/dam/cc/us/en/products/illustrator/icon-design/desktop/SEO_single-app_icon-design_P2b_416x208.jpg.img.jpg) center / cover'}}>
                            Maze game
                        </CardTitle>
                        <CardText>
                            Maze game built in MIPS assembly. Randomely generates a maze on a bit map.
                            User can use their keyboard to move the bit from start to goal.
                        </CardText>
                        <CardActions border>
                            <Button colored>GitHub</Button>
                        </CardActions>
                    </Card>
                    */}

                    <ProjCard
                        projectName="Maze Game"
                        discription="Maze game built in MIPS assembly. Randomely generates a maze on a bit map.User can use their keyboard to move the bit from start to goal."
                        url="https://github.com/cheblankenshipUTD"
                    />

                    {/* Project 2 */}
                    <Card shadow={2} style={{minWidth: '500', margin: 'auto'}}>
                        <CardTitle style={{color: '#fff', height: '176px', background: 'url(https://www.adobe.com/content/dam/cc/us/en/products/illustrator/icon-design/desktop/SEO_single-app_icon-design_P2b_416x208.jpg.img.jpg) center / cover'}}>
                            Location Share App
                        </CardTitle>
                        <CardText>
                            Real time location sharing app. Share your GPS coordinates through iOS app.
                            Display your location on a Google Maps real time.
                        </CardText>
                        <CardActions border>
                            <a href="https://github.com/cheblankenshipUTD" rel="noopener noreferrer" target="_blank">
                                <Button colored>GitHub</Button>
                            </a>
                        </CardActions>
                    </Card>

                    {/* Project 3 */}
                    <Card shadow={2} style={{minWidth: '500', margin: 'auto'}}>
                        <CardTitle style={{color: '#fff', height: '176px', background: 'url(https://www.adobe.com/content/dam/cc/us/en/products/illustrator/icon-design/desktop/SEO_single-app_icon-design_P2b_416x208.jpg.img.jpg) center / cover'}}>
                            Eye Blink App
                        </CardTitle>
                        <CardText>
                            Detect users' eye blinks using Python and OpenCV.
                            Used PyQt5 for User Interface.
                        </CardText>
                        <CardActions border>
                            <Button colored>Read</Button>
                        </CardActions>
                    </Card>

                </div>



            )
        }
        else if (this.state.activeTab === 1) {
            return(
                <div><h1>C++ content coming soon...</h1></div>
            )
        }
        else if (this.state.activeTab === 2) {
            return(
                <div><h1>ML content coming soon...</h1></div>
            )
        }
        else if (this.state.activeTab === 3) {
            return(
                <div><h1>Leetcode content coming soon...</h1></div>
            )
        }
        else if (this.state.activeTab === 4) {
            return(
                <div><h1>Other content coming soon...</h1></div>
            )
        }
        else {
            return(
                <div><h1>This is DS & Algo</h1></div>
            )
        }
    }


    render() {
        return(
            <div className="category-tabs">

                <Tabs activeTab={this.state.activeTab} onChange={(tabId) => this.setState({activeTab: tabId})} >
                    <Tab>DS & Algorithms</Tab>
                    <Tab>C++</Tab>
                    <Tab>Machine Learning</Tab>
                    <Tab>Coding Challenge</Tab>
                    <Tab>Other</Tab>
                </Tabs>


                <Grid>
                    <Cell col={12}>
                        <div className="content">{this.toggleCategories()}</div>
                    </Cell>
                </Grid>

            </div>
        )
    }
}


export default Projects;
